// The 'items' variable automatically holds the array of items from the previous node (Pinecone).
const docs = items.map(i => i.json);

// Initialize variables and a Set to track unique file names (the source documents)
let finalResponseText = '';
const processedFileNames = new Set();

// Handle the case where the RAG search found nothing
if (!docs || docs.length === 0) {
    return [{
        json: {
            RAG_FINAL_TEXT: 'We could not find a matching Knowledge Base article for your specific issue.'
        }
    }];
}

// Loop through each retrieved document
for (const doc of docs) {
    // 1. IDENTIFY UNIQUE SOURCE FILE (for Deduplication)
    const contentObject = doc.document;
    // Note: Using `data.fileName` is common for Pinecone metadata, adjust as needed
    const uniqueFileId = doc.metadata?.['file-name'] || 'Generic_Article'; 

    // *** DEDUPLICATION CHECK ***
    if (processedFileNames.has(uniqueFileId)) {
        continue; // Skip this chunk, it's a duplicate.
    }
    processedFileNames.add(uniqueFileId); // Mark this unique document as processed

    // 2. RETRIEVE CONTENT
    const rawContent = contentObject?.pageContent || ''; 

    // 3. FORMATTING CHANGES (Convert to Markdown/Text structure)
    let formattedContent = rawContent;

    // A. Apply Bolding to Section Headers using Markdown (**)
    formattedContent = formattedContent.replace(/Title:/g, '**Title:**');
    formattedContent = formattedContent.replace(/Overview:/g, '**Overview:**');
    formattedContent = formattedContent.replace(/Step-by-Step Instructions:/g, '**Step-by-Step Instructions:**');

    // B. Convert Steps to Numbered List (1., 2., 3.)
    const lines = formattedContent.split('\n');
    let numberedStepsContent = '';
    let stepCounter = 1;

    for (const line of lines) {
        if (line.trim().startsWith('-')) {
            // Remove leading hyphen and replace it with a numbered step
            numberedStepsContent += line.trim().replace('-', `${stepCounter}. `) + '\n';
            stepCounter++;
        } else {
            // Keep non-step lines as they are
            numberedStepsContent += line + '\n';
        }
    }

    // 4. BUILD FINAL OUTPUT (No Truncation)
    // We are no longer truncating the content here.
    finalResponseText += `\n\n${numberedStepsContent.trim()}`;
} // <-- This is the correct closing brace for the 'for' loop

// CRITICAL: Return only ONE item with the aggregated text
return [{
    json: {
        RAG_FINAL_TEXT: finalResponseText
    }
}];

