// Function node: Build Final HTML ‚Äì robust handling of instructions

let aiOutputString;

try {
  // Get the model output text from the previous AI node
  aiOutputString = items[0].json.output[0].content[0].text;
} catch (e) {
  return [{
    json: {
      FINAL_HTML: '<i>Error: Failed to retrieve content from the AI node.</i>'
    }
  }];
}

// --- Clean and extract JSON string ---

let jsonCandidate = aiOutputString || "";

// Remove markdown fences if present
jsonCandidate = jsonCandidate
  .replace(/```json/i, "")
  .replace(/```/g, "")
  .trim();

// Keep only from first "{" to last "}"
const start = jsonCandidate.indexOf("{");
const end = jsonCandidate.lastIndexOf("}");

if (start !== -1 && end !== -1 && end > start) {
  jsonCandidate = jsonCandidate.slice(start, end + 1);
}

let parsedContent;
try {
  parsedContent = JSON.parse(jsonCandidate);
} catch (e) {
  const safeRaw = aiOutputString.replace(/</g, "&lt;").replace(/>/g, "&gt;");
  return [{
    json: {
      FINAL_HTML: `<p><b>Knowledge Base Articles</b><br>Error: Could not parse AI response.</p><pre>${safeRaw}</pre>`
    }
  }];
}

// --- Build HTML ---

const title = parsedContent.title || "Knowledge Base Article";

// Normalise instructions: handle array OR string
let instructionsRaw = parsedContent.instructions ?? [];
let instructions = [];

if (Array.isArray(instructionsRaw)) {
  instructions = instructionsRaw;
} else if (typeof instructionsRaw === "string") {
  // Split single string into lines, drop empty ones
  instructions = instructionsRaw
    .split(/\r?\n/)
    .map(l => l.trim())
    .filter(l => l.length > 0);
} else {
  instructions = [];
}

let finalResponseText = `
<b>Title:</b> ${title}<br><br>
<b>Overview:</b><br>
Below are the steps to resolve your issue based on our internal knowledge base.<br><br>
<b>Step-by-Step Instructions:</b><br>
`;

if (instructions.length === 0) {
  // Fallback if AI returns no steps
  finalResponseText += `No detailed steps were returned for this request. Please contact the IT Service Desk for further assistance.<br>`;
} else {
  // Render as a numbered HTML list
  finalResponseText += `<ol>`;
  instructions.forEach(step => {
    finalResponseText += `<li>${step}</li>`;
  });
  finalResponseText += `</ol>`;
}


return [{
  json: {
    FINAL_HTML: finalResponseText
  }
}];
